var interval,colorClass="",blinking=!1;function createLites(e,t){const s=document.getElementById("liteBriteContainer");s.innerHTML="";s.style.display="grid",s.style.gridTemplateRows=`repeat(${e}, 1fr)`,s.style.gridTemplateColumns=`repeat(${t}, 1fr)`;for(let n=0;n<e*t;n++){const e=document.createElement("div");e.classList.add("liteBriteLite"),s.appendChild(e),e.addEventListener("click",(function(t){e.classList.contains("on")?e.classList.remove("on"):e.classList.add("on")}))}}function resetGrid(){const e=document.getElementsByClassName("liteBriteLite");for(const t of e)t.classList.remove("on")}